import React from "react"
import ReactDOMClient from "react-dom/client"
import { gc } from './userpage.js'

const app = ReactDOMClient.createRoot(document.getElementById("app"));

var obj;

var ta = [];

function tariffs() {

    const request = new XMLHttpRequest();

    const url = "http://localhost:8080/tariffs";

    request.open("GET", url, true);

    request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

    request.addEventListener("readystatechange", () => {

        if (request.readyState === 4 && request.status === 200) {
            var answer = request.responseText;
            var array = answer.split(';');

            for (let i = 1; i < array.length; i++) {
                obj = JSON.parse(array[i]);
                ta.push(obj);
            }
        }
        app.render(<ShowTariffs t={ta} />);
    });

    request.send();
}

let res = ta.map(function(item) {
    return <p key={item.id}>
       <span>{item.Name}</span>
       <span>{item.Speed}</span>
       <span>{item.Cost}</span>
    </p>;
 });

function creatTariff(props) {
    var g;
    var i = 0;
    var t = [];

    var tariff = {
        Name: "username",
        Speed: 0,
        Cost: 0
    }

    for (i; i < props.t.length; i++) {
        tariff.Name = props.t[i].Name;
        tariff.Speed = props.t[i].Speed;
        tariff.Cost = props.t[i].Cost;
        t.push(tariff);
        console.log(t);
        g = <div>
        <p>Название тарифа: {tariff.Name} </p>
        <p>Скорость тарифа: {tariff.Speed} Mbit/s</p>
        <p>Стоимость тарифа: {tariff.Cost} руб.</p>
    </div>
    }
    return g;
}

function ShowTariffs(props) {
    var h
    h = <div>
        <header>
            <div id="up">
                <a href="/">Личный кабинет</a>
                <a>Вход</a>
                <a>Регистрация</a>
                <a>Тарифы</a>
                <a>О нас</a>
            </div>
        </header>
        <h1>Тарифы провайдера</h1>
        <p>Название тарифа: {props.t[0].Name}</p>
        <p>Скорость тарифа: {props.t[0].Speed} Mbit/s</p>
        <p>Стоимость тарифа: {props.t[0].Cost} руб.</p>
        <button onClick={Buy} id="1" value={props.t[0].ID}>Оформить</button>
        <p></p>
        <p>Название тарифа: {props.t[1].Name}</p>
        <p>Скорость тарифа: {props.t[1].Speed} Mbit/s</p>
        <p>Стоимость тарифа: {props.t[1].Cost} руб.</p>
        <button onClick={Buy} id="2" value={props.t[1].ID}>Оформить</button>
        <p></p>
        <p>Название тарифа: {props.t[2].Name}</p>
        <p>Скорость тарифа: {props.t[2].Speed} Mbit/s</p>
        <p>Стоимость тарифа: {props.t[2].Cost} руб.</p>
        <button onClick={Buy} id="3" value={props.t[2].ID}>Оформить</button>
    </div>

    var h2

    h2 = <div>
        <header>
            <div id="up">
                <a href="/">Личный кабинет</a>
                <a>Вход</a>
                <a>Регистрация</a>
                <a>Тарифы</a>
                <a>О нас</a>
            </div>
        </header>
        <h1>Тарифы провайдера</h1>
        <p>Название тарифа: {props.t[0].Name}</p>
        <p>Скорость тарифа: {props.t[0].Speed} Mbit/s</p>
        <p>Стоимость тарифа: {props.t[0].Cost} руб.</p>
        <p></p>
        <p>Название тарифа: {props.t[1].Name}</p>
        <p>Скорость тарифа: {props.t[1].Speed} Mbit/s</p>
        <p>Стоимость тарифа: {props.t[1].Cost} руб.</p>
        <p></p>
        <p>Название тарифа: {props.t[2].Name}</p>
        <p>Скорость тарифа: {props.t[2].Speed} Mbit/s</p>
        <p>Стоимость тарифа: {props.t[2].Cost} руб.</p>
    </div>
    //h2 = creatTariff(props);
    if (gc("login")) {
        return (
            <div>
                {h}
            </div>
        )
    } else {
        return (
            <div>
                {res}
            </div>
        )
    }
}

const Buy = e => {
    const request = new XMLHttpRequest();

    const url = "http://localhost:8080/settariff";

    const params = "ID=" + e.target.value + "&Login=" + gc("login");

    request.open("POST", url, true);

    request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

